webpackJsonp([0xc69833dc971c],{396:function(e,n){e.exports={data:{site:{siteMetadata:{title:"Nathan Birrell",author:"Nathan Birrell"}},markdownRemark:{id:"/Users/nathan/dev/nathanbirrell.github.io/src/pages/resume/index.md absPath of file >>> MarkdownRemark",html:'<p><strong>Not seeking work</strong></p>\n<!-- Available full-time from: **February 2018**. -->\n<h2>About</h2>\n<p>Determined to make the web a better place with beautiful, maintainable, accessible and thought-out applications.</p>\n<h2>Summary</h2>\n<ul>\n<li>3+ years’ software engineering experience with some of Australia’s largest companies.</li>\n<li>Primary focus is Javascript web-application development. In-depth experience with the React/Redux/Webpack ecosystem. Working knowledge in React Native.</li>\n<li>Building expertise in Ruby on Rails on a side project.</li>\n</ul>\n<h2>Experience</h2>\n<h3><a href="http://surfposeidon.io">Poseidon</a></h3>\n<p>(side project)\nJune 2017 - Present</p>\n<h4>Engineer/Co-founder</h4>\n<ul>\n<li>Building the next generation of surf forecasting.</li>\n<li>On my dream stack: a Ruby on Rails API (my first major Rails project) and a React/Redux/Webpack front-end ecosystem.</li>\n<li>Multiple third-party integrations involved, including: NOAA, BOM, PlanetOS and Willyweather.</li>\n</ul>\n<h3><a href="https://www.belong.com.au">Belong</a></h3>\n<p>powered by Telstra\nNov 2016 - Present</p>\n<h4>Front-end Developer</h4>\n<p>Mid-level Front-end Developer on a React/Redux/Webpack web application. Key activities:</p>\n<ul>\n<li>Tooling: React, Redux, Webpack, ES6/Babel, server-side React rendering</li>\n<li>Built out our hybrid native application using Expo and React Native.</li>\n<li>Onboarding new developers, maintaining Jest unit testing coverage (incl. snapshot and functional tests).</li>\n<li>Migration of our legacy front-end app out of an unmaintainable Knockout/JQuery set-up to a more manageable React/Redux ecosystem.</li>\n</ul>\n<h3><a href="http://www.deloittedigital.com/au/work">Deloitte Digital</a></h3>\n<p>Jan ‘14 - Nov ‘16</p>\n<h4>Front-end Developer</h4>\n<p>Website and web application builds for clients such as <a href="https://www.telstra.com.au">Telstra</a>, <a href="https://www.anz.com.au/personal/">ANZ</a> , <a href="https://www.herbertsmithfreehills.com">Herbert Smith Freehills</a> , <a href="https://www.racq.com.au">RACQ</a>, <a href="https://conexus.victorianccc.org.au">Victorian Comprehensive Cancer Centre</a> and <a href="https://qsuper.qld.gov.au">QSuper</a> .</p>\n<p>Front-end feature development in SCRUM delivery teams:</p>\n<ul>\n<li>Regularly owned front-end estimation and delivery of user stories end-to-end with considerable complexity and time constraints.</li>\n<li>Focussed on improving quality through: objective architectural decisions and discussion, sharing ideas for writing readable and maintainable Javascript and presenting ideas back to the wider FED team.</li>\n<li>Assisted product owners, designers and UX to design solutions that maximise business value from more effective development effort.</li>\n<li>Attended conferences and completed training such as: Deloitte FED training (mostly React &#x26; Angular), Pluralsight courses (i.e. Crockford’s JS Good Parts) and meetups/conferences (MelbJS, LASTConf).</li>\n<li>Helped design/introduce a feature-based Git workflow (‘git flow’) for multiple clients.</li>\n</ul>\n<h3><a href="http://www.theincentivelab.com">The Incentive Lab</a></h3>\n<p>6m contract, 2015</p>\n<h4>Full-Stack Developer (PHP)</h4>\n<ul>\n<li>Part-time (and sole) full-stack PHP developer for the incentive marketing agency’s proprietary software, <a href="www.theflashpointapp.com">Flashpoint</a>, used by sales teams at BMW, Nissan and Samsung in Australia.</li>\n<li>Technologies used: PHP, Symfony, Doctrine ORM, LAMP stack, Wordpress, Javascript/JQuery.</li>\n</ul>\n<h3>Freelance Projects</h3>\n<p>2013 - Dec ‘16</p>\n<h4>Developer / Digital Consultant</h4>\n<ul>\n<li>Worked for myself from university as a web developer and digital consultant to small businesses.</li>\n<li>Provided services from as basic as a Wordpress/Squarespace build to a custom Rails application.</li>\n<li>Clients: <a href="http://damgargroup.com.au/">Damgar Group</a>, <a href="http://gaffneys.com.au/">Gaffneys Logistics</a>, <a href="http://serenityfaceandbody.com.au/">Serenity Face &#x26; Body</a>, All City Bathrooms &#x26; Kitchens, Memla Landscape Architects</li>\n</ul>\n<h3>Apple Retail</h3>\n<p>2014 (Mobile Device Technician)</p>\n<h2>Skills</h2>\n<ul>\n<li>HTML, CSS, Sass</li>\n<li>Javascript, ES6</li>\n<li>Git &#x26; git-flow</li>\n<li>React/Redux front-end ecosystem</li>\n<li>Webpack</li>\n<li>React Native &#x26; Expo</li>\n<li>Ruby &#x26; Rails</li>\n<li>Jest/Enzyme unit testing</li>\n<li>Figma, Sketch, Photoshop, Illustrator</li>\n<li>Heroku</li>\n</ul>\n<h2>Interests</h2>\n<ol>\n<li>Heavy focus on best practices in software development: writing reusable, readable and maintainable code, continuous improvement and quality (through pull requests, pair programming and regular team catch-ups). Opinions heavily influenced by the <a href="http://rubyonrails.org/doctrine/">Rails Doctrine</a>, <a href="https://www.amazon.com/Clean-Code-Handbook-Software-Craftsmanship/dp/0132350882">Clean Code</a> and <a href="http://eloquentjavascript.net/">Eloquent JS</a>.</li>\n<li>Strong interest in wider front-end community involvement and contributing back to open source projects. Regular attendee at MelbJS and Ruby Melbourne meetups. Participant in <a href="https://hacktoberfest.digitalocean.com/">Hacktoberfest</a>.</li>\n<li>Managing teams and workflows around building software. Inspired by many things/people, to name a few: <a href="http://agilemanifesto.org/">Agile manifesto</a>, Lean philosophy, <a href="https://m.signalvnoise.com/">Basecamp</a>, <a href="https://www.amazon.com/Hard-Thing-About-Things-Building/dp/0062273205">Ben Horowitz</a>, <a href="http://sethgodin.typepad.com/">Seth Godin</a> and <a href="http://www.paulgraham.com/articles.html">Paul Graham</a>.</li>\n<li>Outside of work I generally spend <a href="/photos">well away from my computer</a> (mainly surfing/camping).</li>\n</ol>\n<h2>Education</h2>\n<h4>RMIT University</h4>\n<p>2012 - 2015</p>\n<h4>Bachelor of Business (Information Systems) (Applied) (minor in Marketing)</h4>\n<p>St. Kevin’s College</p>\n<p>Completed VCE in 2011</p>\n<h2>Contact</h2>\n<ul>\n<li><a href="https://www.linkedin.com/in/nathanbirrell">LinkedIn</a></li>\n<li><a href="mailto:nathanbirrell@gmail.com">nathanbirrell@gmail.com</a></li>\n</ul>',frontmatter:{title:"Nathan Birrell: CV",date:"April 29, 2018",hide:!0}}},pathContext:{slug:"/resume/",previous:{fields:{slug:"/notes/enzyme-window-events/"},frontmatter:{title:"Test window-bound events on React components using Enzyme/Jest"}},next:null}}}});
